import React, { useEffect, useState } from "react";
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, ResponsiveContainer } from "recharts";
import { useNavigate } from "react-router-dom";

export default function Tracker() {
  const [entries, setEntries] = useState([]);
  const [activity, setActivity] = useState("");
  const [emission, setEmission] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:5000/api/entries")
      .then((res) => res.json())
      .then((data) => setEntries(data));
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!activity || !emission) return;
    const res = await fetch("http://localhost:5000/api/entries", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ activity, emission }),
    });
    const newEntry = await res.json();
    setEntries([newEntry, ...entries]);
    setActivity("");
    setEmission("");
  };

  const handleLogout = () => {
    localStorage.removeItem("user");
    navigate("/login");
  };

  // Prepare chart data
  const chartData = entries
    .slice()
    .reverse()
    .map(e => ({
      date: new Date(e.date).toLocaleDateString(),
      emission: Number(e.emission),
    }));

  return (
  <div className="max-w-xl mx-auto mt-10 p-6 border border-gray-300 rounded-lg bg-white shadow">
    <div className="flex justify-between items-center mb-6">
      <h1 className="text-2xl font-semibold text-gray-800">Carbon Footprint Tracker</h1>
      <button
        onClick={handleLogout}
        className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600 transition"
      >
        Logout
      </button>
    </div>

    <form onSubmit={handleSubmit} className="mb-6 flex flex-wrap gap-2">
      <input
        value={activity}
        onChange={(e) => setActivity(e.target.value)}
        placeholder="Activity"
        className="flex-1 border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
      <input
        value={emission}
        onChange={(e) => setEmission(e.target.value)}
        type="number"
        placeholder="Emission (kg CO2e)"
        min="0"
        className="flex-1 border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
      <button
        type="submit"
        className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 transition"
      >
        Add Entry
      </button>
    </form>

    <h2 className="text-xl font-medium text-gray-700 mb-4">Entries</h2>
    <ul className="list-none space-y-3">
      {entries.map((entry) => (
        <li key={entry._id} className="border-b pb-2 text-gray-600">
          <strong className="text-gray-800">
            {new Date(entry.date).toLocaleDateString()}
          </strong>
          : {entry.activity} â€” {entry.emission} kg CO2e
        </li>
      ))}
      {entries.length === 0 && (
        <li className="text-gray-500 italic">No entries yet.</li>
      )}
    </ul>

    <h3 className="text-lg font-semibold text-gray-700 mt-10 mb-4">Emissions Over Time</h3>
    <div className="w-full h-72">
      <ResponsiveContainer width="100%" height="100%">
        <LineChart data={chartData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis
            label={{ value: "kg CO2e", angle: -90, position: "insideLeft" }}
          />
          <Tooltip />
          <Line type="monotone" dataKey="emission" stroke="#8884d8" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  </div>
);

}
